import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const Section = styled.section`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;
const Header = styled.header`
  display: flex;
  flex-direction: column;
  align-items: center;
  border-bottom: 1px solid grey;
`;
const H3 = styled.h3`
  font-size: 20px;
`;
const ProjectList = styled.ul`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  list-style: none;
`;

const Project = styled.li`
  display: inline;
`;

const ProjectPane = () => {
  return (
    <Section>
      <Header>
        <H3>Projects</H3>
      </Header>
      <ProjectList>
        <Project>FEC</Project>
        <Project>SDC</Project>
        <Project>MVP</Project>
      </ProjectList>
    </Section>
  );
};

export default ProjectPane;
